description:
A group of family and friends on a camping trip through the Texas badlands are taken on a on-way ride to Hell after they inadvertently witness a ritual sacrifice at a deserted campsite.

Pursed by the devil worshiping biker gang responsible, they hole up in an abandoned church near the border, only to discover that they are pawns in a decades-old battle between good and evil...
